import React from 'react'

const WeatherExtraInfo = ({ humidity, wind }) => (
    <div>
        <span>
            {`${humidity} % humidity - `}
        </span>
        <span>
            {`${wind} wind`}
        </span>
    </div>
)

export default WeatherExtraInfo
